-- ----------------------------
-- Function structure for actualizar_fechas_programacion
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."actualizar_fechas_programacion"();
CREATE OR REPLACE FUNCTION "public"."actualizar_fechas_programacion"()
  RETURNS "pg_catalog"."trigger" AS $BODY$
DECLARE
    v_id_tema INT;
    v_fecha_capacitacion DATE;
    v_id_cargo VARCHAR(255);
    v_id_sub_area VARCHAR(255);
BEGIN
    -- Get the tema and fecha from the formulario
    SELECT f.id_tema, f.fecha 
    INTO v_id_tema, v_fecha_capacitacion
    FROM cap_formulario f
    WHERE f.id = NEW.id_formulario;
    
    -- Get cargo ID and sub_area ID from the colaborador if id_colaborador is provided
    IF NEW.id_colaborador IS NOT NULL THEN
        SELECT ac_id_cargo, ac_sub_area
        INTO v_id_cargo, v_id_sub_area
        FROM adm_colaboradores
        WHERE ac_id = NEW.id_colaborador;
    ELSE
        -- Fallback: try to match cargo by name
        SELECT c.id_cargo
        INTO v_id_cargo
        FROM adm_cargos c
        WHERE c.cargo = NEW.cargo
        LIMIT 1;
        
        -- Try to match sub_area by name to get ID
        SELECT a.id_area
        INTO v_id_sub_area
        FROM adm_área a
        WHERE a.sub_area = NEW.sub_área
        LIMIT 1;
    END IF;
    
    -- Skip if training was not approved
    IF NEW.estado_aprobacion != 'aprobo' THEN
        RETURN NEW;
    END IF;
    
    -- Update programacion records that match this training
    -- Match by: tema, cargo, and sub_area (now using IDs)
    UPDATE cap_programacion p
    SET 
        fecha_ultima_capacitacion = GREATEST(
            COALESCE(p.fecha_ultima_capacitacion, v_fecha_capacitacion), 
            v_fecha_capacitacion
        ),
        fecha_proxima_capacitacion = v_fecha_capacitacion + (p.frecuencia_meses * INTERVAL '1 month'),
        fecha_notificacion_previa = (v_fecha_capacitacion + (p.frecuencia_meses * INTERVAL '1 month')) - INTERVAL '1 month'
    WHERE p.id_tema = v_id_tema
    AND p.id_cargo = v_id_cargo
    AND (p.sub_area = v_id_sub_area OR (p.sub_area IS NULL AND v_id_sub_area IS NULL))
    AND p.activo = true;
    
    RETURN NEW;
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;
COMMENT ON FUNCTION "public"."actualizar_fechas_programacion"() IS 'DEPRECATED: Auto-update function for programacion dates. Trigger is disabled by default. Use actualizar_fechas_programacion_manual() instead.';

-- ----------------------------
-- Function structure for actualizar_fechas_programacion_manual
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."actualizar_fechas_programacion_manual"("p_id_programacion" int4, "p_fecha_ultima" date);
CREATE OR REPLACE FUNCTION "public"."actualizar_fechas_programacion_manual"("p_id_programacion" int4, "p_fecha_ultima" date)
  RETURNS "pg_catalog"."void" AS $BODY$
BEGIN
    UPDATE cap_programacion
    SET 
        fecha_ultima_capacitacion = p_fecha_ultima,
        fecha_proxima_capacitacion = p_fecha_ultima + (frecuencia_meses * INTERVAL '1 month'),
        fecha_notificacion_previa = (p_fecha_ultima + (frecuencia_meses * INTERVAL '1 month')) - INTERVAL '1 month'
    WHERE id = p_id_programacion
    AND activo = true;
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;
COMMENT ON FUNCTION "public"."actualizar_fechas_programacion_manual"("p_id_programacion" int4, "p_fecha_ultima" date) IS 'Manually update programacion dates based on last training date';

-- ----------------------------
-- Function structure for actualizar_notificaciones_capacitacion
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."actualizar_notificaciones_capacitacion"();
CREATE OR REPLACE FUNCTION "public"."actualizar_notificaciones_capacitacion"()
  RETURNS "pg_catalog"."void" AS $BODY$
BEGIN
  -- Step 1: Delete old notifications for inactive schedules
  DELETE FROM cap_notificaciones 
  WHERE id_programacion IN (
    SELECT id FROM cap_programacion WHERE activo = false
  );

  -- Step 2 & 3: Create temp table with new notification data
  CREATE TEMP TABLE IF NOT EXISTS temp_notificaciones AS
  WITH ultima_capacitacion AS (
    SELECT 
      c.ac_id,
      p.id as programacion_id,
      MAX(CASE WHEN fa.id IS NOT NULL THEN f.fecha ELSE NULL END) AS fecha_ultima,
      p.frecuencia_meses
    FROM 
      adm_colaboradores c
      INNER JOIN cap_programacion p ON c.ac_id_cargo = p.id_cargo 
        AND (p.sub_area IS NULL OR p.sub_area = c.ac_sub_area)
        AND p.activo = true
      LEFT JOIN cap_formulario f ON f.id_tema = p.id_tema
      LEFT JOIN cap_formulario_asistente fa ON fa.id_formulario = f.id AND fa.cedula = c.ac_cedula
    WHERE 
      c.ac_id_situación IN ('A', 'V', 'P')
    GROUP BY 
      c.ac_id, p.id, p.frecuencia_meses
  )
  SELECT 
    uc.ac_id as id_colaborador,
    uc.programacion_id as id_programacion,
    uc.fecha_ultima as fecha_ultima_capacitacion,
    CASE 
      WHEN uc.fecha_ultima IS NULL THEN CURRENT_DATE
      ELSE uc.fecha_ultima + (uc.frecuencia_meses * INTERVAL '1 month')
    END AS fecha_proxima,
    CASE 
      WHEN uc.fecha_ultima IS NULL THEN 0
      ELSE EXTRACT(DAY FROM (uc.fecha_ultima + (uc.frecuencia_meses * INTERVAL '1 month') - CURRENT_DATE))::int
    END AS dias_para_vencimiento,
    CASE 
      WHEN uc.fecha_ultima IS NULL THEN 'pendiente'
      WHEN (uc.fecha_ultima + (uc.frecuencia_meses * INTERVAL '1 month')) < CURRENT_DATE THEN 'vencida'
      WHEN (uc.fecha_ultima + (uc.frecuencia_meses * INTERVAL '1 month')) <= (CURRENT_DATE + INTERVAL '30 days') THEN 'proximo_vencer'
      ELSE 'vigente'
    END AS estado
  FROM ultima_capacitacion uc;

  -- Step 4: Update existing notifications
  UPDATE cap_notificaciones cn SET
    fecha_ultima_capacitacion = tn.fecha_ultima_capacitacion,
    fecha_proxima = tn.fecha_proxima,
    dias_para_vencimiento = tn.dias_para_vencimiento,
    estado = tn.estado,
    fecha_actualizacion = CURRENT_TIMESTAMP
  FROM temp_notificaciones tn
  WHERE cn.id_colaborador = tn.id_colaborador
    AND cn.id_programacion = tn.id_programacion;

  -- Step 5: Insert new notifications
    id_colaborador,
    id_programacion,
    fecha_ultima_capacitacion,
    fecha_proxima,
    dias_para_vencimiento,
    estado
  )
  SELECT 
    tn.id_colaborador,
    tn.id_programacion,
    tn.fecha_ultima_capacitacion,
    tn.fecha_proxima,
    tn.dias_para_vencimiento,
    tn.estado
  FROM temp_notificaciones tn
  WHERE NOT EXISTS (
    SELECT 1 FROM cap_notificaciones cn
    WHERE cn.id_colaborador = tn.id_colaborador
      AND cn.id_programacion = tn.id_programacion
  );

  -- Cleanup
  DROP TABLE IF EXISTS temp_notificaciones;
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;
COMMENT ON FUNCTION "public"."actualizar_notificaciones_capacitacion"() IS 'Updates training notifications based on completed trainings and schedules (PostgreSQL 9.x compatible)';

-- ----------------------------
-- Function structure for inicializar_fechas_programacion
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."inicializar_fechas_programacion"();
CREATE OR REPLACE FUNCTION "public"."inicializar_fechas_programacion"()
  RETURNS "pg_catalog"."void" AS $BODY$
BEGIN
    -- Set initial dates for programacion records that don't have them
    -- Use current date as base for records without any training history
    UPDATE cap_programacion
    SET 
        fecha_proxima_capacitacion = CURRENT_DATE + (frecuencia_meses || ' months')::INTERVAL,
        fecha_notificacion_previa = CURRENT_DATE + (frecuencia_meses || ' months')::INTERVAL - INTERVAL '1 month'
    WHERE fecha_proxima_capacitacion IS NULL
    AND activo = true;
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;
COMMENT ON FUNCTION "public"."inicializar_fechas_programacion"() IS 'One-time initialization of dates for existing programacion records without dates';

