DROP FUNCTION IF EXISTS "public"."trigger_set_updated_at"();
CREATE OR REPLACE FUNCTION "public"."trigger_set_updated_at"()
  RETURNS "pg_catalog"."trigger" AS $BODY$
BEGIN
  NEW.updated_at := now();
  RETURN NEW;
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

